import React from 'react'
import styled from 'styled-components';

const Wrapper = styled.div`
  position: relative;
  display: flex;
  align-items: center;
  padding: 30px 30px 30px 31px;
  cursor: pointer;
`;

export const Accordion = () => {
  return <Wrapper>asdf</Wrapper>
}
